import{_ as a,c as t,o,ag as r}from"./chunks/framework.S-Qvb3wi.js";const p=JSON.parse('{"title":"General Questions","description":"","frontmatter":{"title":"General Questions","lang":"en-US","outline":"deep","lastUpdated":true,"search":true},"headers":[],"relativePath":"faq/general.md","filePath":"faq/general.md","lastUpdated":1762010095000}'),n={name:"faq/general.md"};function i(s,e,d,l,h,u){return o(),t("div",null,e[0]||(e[0]=[r('<h1 id="frequently-asked-questions" tabindex="-1">Frequently Asked Questions <a class="header-anchor" href="#frequently-asked-questions" aria-label="Permalink to &quot;Frequently Asked Questions&quot;">​</a></h1><h2 id="general-questions" tabindex="-1">General Questions <a class="header-anchor" href="#general-questions" aria-label="Permalink to &quot;General Questions&quot;">​</a></h2><h3 id="where-are-the-leaks" tabindex="-1">Where are the leaks? <a class="header-anchor" href="#where-are-the-leaks" aria-label="Permalink to &quot;Where are the leaks?&quot;">​</a></h3><p>Our leaks are available in our Discord Server: <a href="https://discord.gg/6ure" target="_blank" rel="noreferrer">https://discord.gg/6ure</a></p><blockquote><p>You can find beginners guide here: <a href="/beginners">Beginners</a></p></blockquote><h3 id="how-do-i-install-x-plugin" tabindex="-1">How do I install [X] plugin? <a class="header-anchor" href="#how-do-i-install-x-plugin" aria-label="Permalink to &quot;How do I install [X] plugin?&quot;">​</a></h3><p>Many plugins or software files include a <code>read me.txt</code> or <code>attention</code> file. Please make sure to carefully read any such file that comes with your download, as it usually contains important installation instructions. If the file is not included, you can look for installation tutorials on platforms like TikTok or YouTube.</p><h3 id="which-plug-ins-do-i-get-what-are-their-uses" tabindex="-1">Which plug-ins do I get, what are their uses? <a class="header-anchor" href="#which-plug-ins-do-i-get-what-are-their-uses" aria-label="Permalink to &quot;Which plug-ins do I get, what are their uses?&quot;">​</a></h3><p>Each plugin has a different function. If you’re new to editing, we recommend starting with Sapphire, BCC, and Magic Bullet Looks (MBL), as these are the most popular plugins in the community and provide a great starter for your edits. Be sure to check out these helpful videos explaining what each plugin does:</p><ul><li><a href="https://youtu.be/TJP2qQC5QG0?si=ODht4yKvzU_rhRhn" target="_blank" rel="noreferrer">What each plugin does</a></li><li><a href="https://youtu.be/93RMVIHQ-9E?si=pC4n4pCigpyz7qKi" target="_blank" rel="noreferrer">Another video explaining their features</a></li></ul><h3 id="when-i-apply-x-to-my-edit-a-red-x-appears-on-it" tabindex="-1">When I apply [X] to my edit, a red X appears on it. <a class="header-anchor" href="#when-i-apply-x-to-my-edit-a-red-x-appears-on-it" aria-label="Permalink to &quot;When I apply [X] to my edit, a red X appears on it.&quot;">​</a></h3><p>A red X means that whatever plugin you&#39;re using is unlicensed. This means that you did not install it properly and that you should try again from scratch. Make sure to properly read the read me.txt if there is one.</p><h3 id="nothing-is-working-what-do-i-do" tabindex="-1">Nothing is working, what do I do? <a class="header-anchor" href="#nothing-is-working-what-do-i-do" aria-label="Permalink to &quot;Nothing is working, what do I do?&quot;">​</a></h3><p>If you’ve tried multiple sources and still have problems, it could be due to an error on your side or an issue on our end. To fix this, you can consider getting plugins from a different source or try to find the problem if we don’t see any issues on our side. It is important to note that most of these plugins are outside our control, so problems are rare.</p><p>You are welcome to join the server below if you&#39;d like. They offer much broader options and assistance.</p><ul><li><a href="https://discord.gg/pc6j7Qy4PU" target="_blank" rel="noreferrer">Saturn ✦</a></li></ul><h3 id="i-cannot-find-what-i-m-looking-for-can-you-guys-update-the-page" tabindex="-1">I cannot find what I&#39;m looking for. Can you guys update the page? <a class="header-anchor" href="#i-cannot-find-what-i-m-looking-for-can-you-guys-update-the-page" aria-label="Permalink to &quot;I cannot find what I&#39;m looking for. Can you guys update the page?&quot;">​</a></h3><p>As mentioned earlier on this site, we kindly ask for your patience as we continue to upload resources. The servers listed above offer broader variety of plugins than we currently have. If you can’t find a specific resource here, we recommend checking the server for additional support.<br> Also, if you’re experienced with using and patching software, you can refer to the first section under the “Extras” category for access to Adobe software. However, we strongly suggest using this only as a last option and trying the said server first.</p><h2 id="downloading-presets" tabindex="-1">Downloading Presets <a class="header-anchor" href="#downloading-presets" aria-label="Permalink to &quot;Downloading Presets&quot;">​</a></h2><h3 id="what-does-sharing-has-expired-means" tabindex="-1">What does &#39;Sharing has expired&#39; means? <a class="header-anchor" href="#what-does-sharing-has-expired-means" aria-label="Permalink to &quot;What does &#39;Sharing has expired&#39; means?&quot;">​</a></h3><p>The download link has expired, as it is only valid for 1 hour after clicking the download button. If you require a second download, please click the download button again to generate a new link.</p><h3 id="what-does-maximum-sharing-usage-exceeded-means" tabindex="-1">What does &#39;Maximum sharing usage exceeded&#39; means? <a class="header-anchor" href="#what-does-maximum-sharing-usage-exceeded-means" aria-label="Permalink to &quot;What does &#39;Maximum sharing usage exceeded&#39; means?&quot;">​</a></h3><p>The download link has reached its maximum usage limit. Each link can only be used once, resulting in a single download per link. If you require a second download, kindly click the download button again to generate a new link.</p><h3 id="what-does-the-requested-resource-does-not-exist-means" tabindex="-1">What does &#39;The requested resource does not exist&#39; means? <a class="header-anchor" href="#what-does-the-requested-resource-does-not-exist-means" aria-label="Permalink to &quot;What does &#39;The requested resource does not exist&#39; means?&quot;">​</a></h3><p>In most cases, the token has expired. To resolve this issue, kindly wait a few minutes and obtain a new link. If the problem persists, it is likely that the resource path is incorrect. In such instances, you may need to contact our founder or developer, @ihyledd or @tcmmi.ae, through tickets.</p><h3 id="what-does-invalid-credentials-means" tabindex="-1">What does &#39;Invalid Credentials&#39; means? <a class="header-anchor" href="#what-does-invalid-credentials-means" aria-label="Permalink to &quot;What does &#39;Invalid Credentials&#39; means?&quot;">​</a></h3><p>The password you entered on our website is incorrect. Please verify that you have obtained it from our official website and not from any other source.</p>',27)]))}const g=a(n,[["render",i]]);export{p as __pageData,g as default};
